import React from 'react';
import {MuiPickersUtilsProvider} from "@material-ui/pickers";
import DateFnsUtils from "@date-io/date-fns";
import {Button, Paper, Table, TableBody, TableCell, TableHead, TableRow} from "@material-ui/core";
import {ThemeProvider} from "@material-ui/core/styles";
import AddFacultyAttendanceDialog from "../../FacultyAttendanceSection/Panel/Dialogs/AddFacultyAttendanceDialog";

const ListSubjectTable = props => {
  const tableHeaders = ["Faculty Name", "Department", "Working Days", "Actions"];
  return (
    <MuiPickersUtilsProvider utils={DateFnsUtils}>
      <Paper elevation={3}>
        <Table size={'medium'}>
          <TableHead>
            <TableRow>
              {tableHeaders.map((tableHeader, index) => (
                <TableCell
                  key={index}
                  align={'left'}
                  padding={'default'}
                  sortDirection={false}
                >
                  {tableHeader}
                </TableCell>
              ))}
            </TableRow>
          </TableHead>
          <TableBody>
            <TableRow>
              <TableCell component="th" scope="row">
                Akshay Mahajan
              </TableCell>
              <TableCell>ECE</TableCell>
              <TableCell>7</TableCell>
              <TableCell>
                <ThemeProvider theme={theme}>
                  <Button variant="contained" color="primary" style={{ color: "white" }} onClick={() => setOpenAttendanceDialog(true)}>
                    Mark Attendance
                  </Button>
                </ThemeProvider>
              </TableCell>
            </TableRow>
          </TableBody>
        </Table>
      </Paper>
    </MuiPickersUtilsProvider>
  );
}

export default ListSubjectTable;
